import { createRouter, createWebHistory } from 'vue-router';

const routes = [
  { 
    path: '/', 
    name: 'HomePage', 
    component: () => import('./components/HomePage.vue') // Ensure path is correct
  },
  { 
    path: '/sign-up', 
    name: 'SignUp', 
    component: () => import('./components/SignUp.vue') // Ensure path is correct
  },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
